const styles=(theme)=>({
    signup:{
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        justifyContent: 'center',
        textAlign: 'center',
        flex:'1 0 auto',
    },
    cardContent:{
        fontSize: '1em',
    },
    card:{
        maxWidth: '100%',
    },
    typography:{
        fontSize: '1.3em',
    },
    textField:{
        fontSize: '60%',
    },
    button:{
        margin: 10,
        width: '40%',
        fontSize: '70%'
    },
    Checkbox:{
        fontSize: '0.6em'

    }
});
export default styles;
